import ReactEcharts from "echarts-for-react";
import React from "react";
import { Col, Row } from 'antd';
import {optionVizScatter1} from "./chart_options";


export function VizScatter_test (data: number[][][] , height: string, fsize: number) {
    return (
        <div>
            <Row>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
            </Row>

            <Row>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
            </Row>

            <Row>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
            </Row>

            <Row>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
            </Row>
        </div>
    )
}

